import React, { Component } from 'react';
import { Link } from 'react-router-dom';
import { Badge, DropdownButton, Dropdown } from 'react-bootstrap';

class Home extends Component {
  constructor(props) {
    super(props)
    this.state = {
      content: ""
    }
  }

  getRes() {
    fetch('/api/getRes')
    .then(res => res.json())
    .then(content => this.setState({ content: content }))
  }

  render() {
    return (
    <div style={{display: "flex", justifyContent: "center", marginTop: "30px"}}>
      <div style={{width: "70%", textAlign: "flex-start"}}>
        <h1>
          Been There
        </h1>
          We all go through hard times, and sometimes it's nice to simply know that you aren't alone.
          Post your stories of hard times to see similar stories and get affirmation that you really
          arent alone.
        <div style={{ flexDirection: "column" }}>
        sorting by
        <DropdownButton id="dropdown-item-button" title="Dropdown button">
          <Dropdown.Item as="button">Action</Dropdown.Item>
          <Dropdown.Item as="button">Another action</Dropdown.Item>
          <Dropdown.Item as="button">Something else</Dropdown.Item>
        </DropdownButton>
        </div>
        {this.state.content}
      </div>
    </div>
    );
  }
}
export default Home;
